func contains(name string, config_links []*config_proto.GUILink) bool {
	for _, i := range config_links {
		if i.Text == name {
			return true
		}
	}
	return false
}

// Merge the user's links with the default built-in links but do not
// override them!
func MergeGUILinks(
	config_links []*config_proto.GUILink,
	source []*config_proto.GUILink) []*config_proto.GUILink {
	for _, link := range source {
		if !contains(link.Text, config_links) {
			config_links = append(config_links, link)
		}
	}

	return config_links
}
